import React from 'react';
import { connect } from 'react-redux';

import Input from '../input'
import Button from '../button'

import './login.css';

class Login extends React.Component {
  onLogin() {
    this.props.history.push('/home')
  };

  render() {
    return (
      <div className="login-wrapper">
        <div className="left-content-login">
          <span className="text-login-left">Hello! Wellcome to Demo</span>
        </div>
        <div className="form-login">
          <Input id='user-name' type='text' placeholder='Enter Username' />
          <Input id='pass-word' type='password' placeholder='Enter Password' />
          <Button text='Login' handleClick={() => this.onLogin()} />
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    currentDataCat: state.home.dataCat,
